import React, { Component } from "react";

import Popular from "./Component/Popular";
import Ratedlocations from "./Component/Ratedlocations";
import Tourplaces from "./Component/Tourplaces";
import Footer from "./Component/Footer";
import Mobileapp from "./Component/Mobileapp";
import BlogNews from "./Component/BlogNews";
import Features from "./Component/Features";
import Customerssays from "./Component/Customerssays";
import Favourite from "./Component/Favourite";
import Totalstatus from "./Component/Totalstatus";
import Restaurents from "./Component/Restaurents";
import Nav from "./Component/Nav";
import Header from "./Component/Header";

function App() {
  return (
    <>
      <Nav />
      <Header />
      <Popular />
      <Ratedlocations />
      <Tourplaces />
      <Restaurents />
      <Totalstatus />
      <Favourite />
      <Customerssays />
      <Features />
      <BlogNews />
      <Mobileapp />
      <Footer />
    </>
  );
}

export default App;
